	videoWidth, 
	videoHeight, 
	waiting = false, 
	triangleSeed, 
	totalFiles = 0;

function resizeVideo()
{
	if(waiting) return;
	if ($("#background_video")[0].readyState == 0)
	{
		waiting = true;
		$("#background_video").on("loadedmetadata", function() {
			waiting = false;
			resizeVideo();
		});
		return;
	}
	
	// Because of the way videos work, we need to size it so that we maintain the aspect ratio.
	if(!videoWidth || !videoHeight)
	{
		videoWidth = $("#background_video")[0].videoWidth;
		videoHeight = $("#background_video")[0].videoHeight;
	}
	
	var ratio = videoHeight / videoWidth;
	if(videoWidth > videoHeight)
	{
		$("#background_video").width($(window).width());
		$("#background_video").height(ratio * $(window).width());
	}
	else
	{
		$("#background_video").width(ratio * $(window).height());
		$("#background_video").height($(window).height());
	}
}

$(document).ready(function() {
	// If the background video exists, make sure it fits the browser viewport.
	if($("#background_video").length)
	{
		resizeVideo();
	}
	
	// If we're in testing mode, simulate function calls
	if(location.search.indexOf("testing=true") > -1)
	{
		GameDetails(
			"DGLoad Testing Mode",
			location.href,
			"rp_bangclaw",
			32,
			"76561197960435530",
			"ttt"
		);
		
		var total = 10;
		SetFilesTotal(total);
		// Used to generate a random file.
		var fileInfo = [
			{ path: "models/", extension: ".mdl" },
			{ path: "maps/", extension: ".bsp" },
			{ path: "materials/", extension: ".vtf" },
			{ path: "sounds/", extension: ".wav" }
		];
		
		SetStatusChanged("Connecting to server...");
		
		setTimeout(function() {
			SetStatusChanged("Retrieving server info...");
		
			setInterval(function() {
				var filename = Math.random().toString(16).substr(2) + Math.random().toString(16).substr(2);
				var randomInfo = fileInfo[Math.floor(Math.random() * fileInfo.length)];
				DownloadingFile(randomInfo.path + filename + randomInfo.extension);
				SetFilesNeeded(--total);
				
				if(total == 0)
				{
					SetStatusChanged("Sending client info...");
					total = 10;
					SetFilesTotal(10);
				}
			}, 1000);
		}, 2000);
	}
});

// Handle resize.
$(window).resize(function() {
	if($('#background_video').length > 0)
	{
		resizeVideo();
	}
});

// Functions that are called from Garry's Mod
function GameDetails(serverName, serverUrl, mapName, maxPlayers, steamID, gamemode)
{
	$(".server .name").text(serverName);
	$(".server .mapname").text(mapName);
	$(".server .gamemode").text(GamemodeNames[gamemode] || gamemode);
	$(".progress.indicator").progress({ percent: 0 });
}

function SetFilesTotal(_totalFiles)
{
	totalFiles = _totalFiles;
}

function DownloadingFile(fileName)
{
	$(".progress .label").text("Downloading " + fileName + "...");
}

function SetStatusChanged(status)
{
	$(".progress .label").text(status);
	if(
		(status.toLowerCase().indexOf('client') != -1 && status.toLowerCase().indexOf('info') != -1) ||
		(status.toLowerCase().indexOf('initializing game info') != -1) ||
		(status.toLowerCase().indexOf('retrieving game') != -1))
	{
		$(".progress.indicator").progress({ percent: 100 });
	}
}

function SetFilesNeeded(needed)
{
	$(".progress.indicator").progress({
		percent: ((totalFiles - needed) / totalFiles) * 100
	});
}

// YT API integration
var ytReadyCallbacks = ytReadyCallbacks || [];
var tag = document.createElement('script');
tag.src = "https://www.youtube.com/iframe_api";
var firstScriptTag = document.getElementsByTagName('script')[0];
firstScriptTag.parentNode.insertBefore(tag, firstScriptTag);

function onYouTubeIframeAPIReady() 
{
	ytReadyCallbacks.forEach(function(c) { c(); });
}